<node TEXT="using System;&#xa;using System.Collections;&#xa;&#xa;public class VolatileCollection: IEnumerable&#xa;{&#xa;    private object[ ] _items = null;&#xa;&#xa;    public VolatileCollection(object[ ] array)&#xa;    {&#xa;        _items = array;&#xa;    }&#xa;&#xa;    public IEnumerator GetEnumerator( )&#xa;    {&#xa;        return new Enumerator(_items);&#xa;    }&#xa;&#xa;    private class Enumerator: IEnumerator&#xa;    {&#xa;        private int _cursor;&#xa;        private object[ ] _elements = null;&#xa;&#xa;        public Enumerator(object[ ] items)&#xa;        {&#xa;            _elements = new object[items.Length];&#xa;            Array.Copy(items, _elements, items.Length);&#xa;            _cursor = -1;&#xa;        }&#xa;&#xa;        public bool MoveNext( )&#xa;        {&#xa;            ++_cursor;&#xa;            if( _cursor &gt; (_elements.Length - 1) )&#xa;            {&#xa;                return false;&#xa;            }&#xa;            return true;&#xa;        }&#xa;&#xa;        public void Reset( )&#xa;        {&#xa;            _cursor = -1;&#xa;        }&#xa;&#xa;        public object Current&#xa;        {&#xa;            get&#xa;            {&#xa;                if (_cursor &gt; (_elements.Length - 1) )&#xa;                {&#xa;                    throw new InvalidOperationException(&#xa;                        &quot;Enumeration already finished&quot;);&#xa;                }&#xa;                if (_cursor == -1)&#xa;                {&#xa;                    throw new InvalidOperationException(&#xa;                        &quot;Enumeration not started&quot;);&#xa;                }&#xa;                return _elements[_cursor];&#xa;            }&#xa;        }&#xa;    }&#xa;}&#xa;&#xa;public class Starter&#xa;{&#xa;    public static void Main()&#xa;    {&#xa;        VolatileCollection volatileCollection = new VolatileCollection(&#xa;            new object[ ] {1,2,3,4,5,6,7});&#xa;        IEnumerator enumerator = volatileCollection.GetEnumerator( );&#xa;        while(enumerator.MoveNext( ) )&#xa;        {&#xa;            Console.WriteLine(enumerator.Current);&#xa;        }&#xa;    }&#xa;}" ID="Freemind_Link_1254708206" CREATED="1207050059078" MODIFIED="1554526155477" COLOR="#000000" BACKGROUND_COLOR="#c898ff" STYLE="bubble">
