<node TEXT="using System;&#xa;using System.Collections;&#xa;&#xa;public class VersionedCollection: IEnumerable&#xa;{&#xa;    private object[ ] _items = null;&#xa;    private int _version;&#xa;&#xa;    public VersionedCollection(object[ ] array)&#xa;    {&#xa;        _items = array;&#xa;        _version = 1;&#xa;    }&#xa;&#xa;    public object this[int index]&#xa;    {&#xa;        get { return _items[index]; }&#xa;        set &#xa;        {&#xa;            ++_version;&#xa;            _items[index] = value;&#xa;        }&#xa;    }&#xa;&#xa;    public IEnumerator GetEnumerator( )&#xa;    {&#xa;        // Passes reference to the current instance of &#xa;        //  VersionedCollection, rather than to the _items &#xa;        //  object.&#xa;        return new Enumerator(this);&#xa;    }&#xa;&#xa;    private class Enumerator: IEnumerator&#xa;    {&#xa;        private int _version;&#xa;        private int _cursor;&#xa;        private VersionedCollection _oThis;&#xa;&#xa;        public Enumerator(VersionedCollection obj)&#xa;        {&#xa;            _oThis = obj;&#xa;            _cursor = -1;&#xa;            _version = _oThis._version;&#xa;        }&#xa;&#xa;        public bool MoveNext( )&#xa;        {&#xa;            ++_cursor;&#xa;            if( _cursor &gt; (_oThis._items.Length - 1) )&#xa;            {&#xa;                return false;&#xa;            }&#xa;            return true;&#xa;        }&#xa;&#xa;        public void Reset( )&#xa;        {&#xa;            _cursor = -1;&#xa;        }&#xa;&#xa;        public object Current&#xa;        {&#xa;            get&#xa;            {&#xa;                if (_oThis._version != _version)&#xa;                {&#xa;                    throw new InvalidOperationException(&#xa;                        &quot;Collection was modified&quot;);&#xa;                }&#xa;                if (_cursor &gt; (_oThis._items.Length - 1) )&#xa;                {&#xa;                    throw new InvalidOperationException(&#xa;                        &quot;Enumeration already finished&quot;);&#xa;                }&#xa;                if (_cursor == -1)&#xa;                {&#xa;                    throw new InvalidOperationException(&#xa;                        &quot;Enumeration not started&quot;);&#xa;                }&#xa;                return _oThis._items[_cursor];&#xa;            }&#xa;        }&#xa;    }&#xa;}&#xa;&#xa;public class Starter&#xa;{&#xa;    public static void Main()&#xa;    {&#xa;        VersionedCollection collection = new VersionedCollection(&#xa;            new object[ ] {1,2,3,4,5,6,7} );&#xa;        IEnumerator enumerator = collection.GetEnumerator( );&#xa;        enumerator.MoveNext( );&#xa;        Console.WriteLine(enumerator.Current);&#xa;        enumerator.MoveNext( );&#xa;        collection[ 4 ] = 10;&#xa;        Console.WriteLine(enumerator.Current);  // Exception since collection modified.&#xa;        enumerator.MoveNext( );&#xa;    }&#xa;}" ID="Freemind_Link_236125184" CREATED="1207127678250" MODIFIED="1554526155509" COLOR="#000000" BACKGROUND_COLOR="#c898ff" STYLE="bubble">
