<node TEXT="using System;&#xa;using System.Collections.Generic;&#xa;&#xa;public class ReverseIterator&#xa;{&#xa;    private int[ ] _list1 = new int [ ] {0,2,4,6,8};&#xa;&#xa;    public IEnumerator&lt;int&gt; GetEnumerator( )&#xa;    {&#xa;        for(int index = 0; index &lt; 5; ++index)&#xa;        {&#xa;            yield return _list1[index];&#xa;        }&#xa;    }&#xa;&#xa;    public IEnumerable&lt;int&gt; Reverse&#xa;    {&#xa;        get&#xa;        {&#xa;            for(int index = 4; index &gt;= 0; --index)&#xa;            {&#xa;                yield return _list1[index];&#xa;            }&#xa;        }&#xa;    }&#xa;}&#xa;&#xa;public class Starter&#xa;{&#xa;    public static void Main()&#xa;    {&#xa;        Console.WriteLine(&quot;Forward List&quot;);&#xa;        ReverseIterator obj = new ReverseIterator( );        &#xa;        foreach(int item in obj)&#xa;        {&#xa;            Console.Write(item);&#xa;        }&#xa;        Console.WriteLine(&quot;\nReverse List&quot;);       &#xa;        foreach(int item in obj.Reverse)&#xa;        {&#xa;            Console.Write(item);&#xa;        }&#xa;    }&#xa;}" ID="Freemind_Link_1906552873" CREATED="1207135445953" MODIFIED="1554526155696" COLOR="#000000" BACKGROUND_COLOR="#ffffdb" STYLE="fork" BORDER_WIDTH_LIKE_EDGE="true">
