<node TEXT="using System;&#xa;using System.Collections;&#xa;using System.Collections.Generic;&#xa;&#xa;public class GenericVersionedCollection&lt;T&gt;: IEnumerable&lt;T&gt;&#xa;{&#xa;    private T[ ] _items = null;&#xa;    private int _version;&#xa;&#xa;    public GenericVersionedCollection(T[ ] array)&#xa;    {&#xa;        _items = array;&#xa;        _version = 1;&#xa;    }&#xa;&#xa;    public T this[int index]&#xa;    {&#xa;        get { return _items[index]; }&#xa;        set &#xa;        {&#xa;            ++_version;&#xa;            _items[index] = value;&#xa;        }&#xa;    }&#xa;&#xa;    public IEnumerator&lt;T&gt; GetEnumerator( )&#xa;    {&#xa;        Console.WriteLine(&quot;IEnumerator&lt;T&gt; GetEnumerator( )&quot;);&#xa;        return new Enumerator&lt;T&gt;(this);&#xa;    }&#xa;&#xa;    IEnumerator IEnumerable.GetEnumerator( )&#xa;    {&#xa;        Console.WriteLine(&quot;IEnumerator GetEnumerator( )&quot;);&#xa;        return new Enumerator&lt;T&gt;(this);&#xa;    }&#xa;&#xa;    private class Enumerator&lt;__T&gt;: IEnumerator&lt;__T&gt;&#xa;    {&#xa;        private int _version;&#xa;        private int _cursor;&#xa;        private GenericVersionedCollection&lt;__T&gt; _oThis;&#xa;&#xa;        public Enumerator(GenericVersionedCollection&lt;__T&gt; obj)&#xa;        {&#xa;            _oThis = obj;&#xa;            _cursor = -1;&#xa;            _version = _oThis._version;&#xa;        }&#xa;&#xa;        public bool MoveNext( )&#xa;        {&#xa;            ++_cursor;&#xa;            if( _cursor &gt; (_oThis._items.Length - 1) )&#xa;            {&#xa;                return false;&#xa;            }&#xa;            return true;&#xa;        }&#xa;&#xa;        public void Reset( )&#xa;        {&#xa;            _cursor = -1;&#xa;        }&#xa;&#xa;        public void Dispose( )&#xa;        {&#xa;            // Sets state machine to After state.&#xa;            _cursor = _oThis._items.Length + 1;&#xa;        }&#xa;&#xa;        public __T Current&#xa;        {&#xa;            get&#xa;            {&#xa;                if (_oThis._version != _version)&#xa;                {&#xa;                    throw new InvalidOperationException(&#xa;                        &quot;Collection was modified&quot;);&#xa;                }&#xa;                if (_cursor &gt; (_oThis._items.Length - 1) )&#xa;                {&#xa;                    throw new InvalidOperationException(&#xa;                        &quot;Enumeration already finished&quot;);&#xa;                }&#xa;                if (_cursor == -1)&#xa;                {&#xa;                    throw new InvalidOperationException(&#xa;                        &quot;Enumeration not started&quot;);&#xa;                }&#xa;                return _oThis._items[_cursor];&#xa;            }&#xa;        }&#xa;&#xa;        // Non-generic version calls the generic version.&#xa;        object IEnumerator.Current&#xa;        {&#xa;            get { return Current; }&#xa;        }&#xa;    }&#xa;}&#xa;&#xa;public class Starter&#xa;{&#xa;    public static void Main()&#xa;    {&#xa;        GenericVersionedCollection&lt;int&gt; collection = &#xa;            new GenericVersionedCollection&lt;int&gt;(&#xa;                new int[ ] {1,2,3,4,5,6,7} );&#xa;        &#xa;        foreach(int number in collection)&#xa;        {&#xa;            Console.WriteLine(number);&#xa;        }&#xa;        foreach(int number in (IEnumerable)collection)&#xa;        {&#xa;            Console.WriteLine(number);&#xa;        }&#xa;    }&#xa;}&#xa;" ID="Freemind_Link_1722383020" CREATED="1207131265843" MODIFIED="1554526155774" COLOR="#000000" BACKGROUND_COLOR="#ffffdb" STYLE="fork" BORDER_WIDTH_LIKE_EDGE="true">
